webpackJsonp([0xde79be515c30],{521:function(a,e){a.exports={data:{site:{siteMetadata:{title:"Dogiant's Blog",author:"Andy Do"}},markdownRemark:{id:"/data/javascript-lab/dogiant.github.io/src/pages/how-to-convert-silk-audio-file-from-wechat-to-wav-format/index.md absPath of file >>> MarkdownRemark",html:'<p>奶奶八十多了，经常与远隔千里之外的我微信互动交流。</p>\n<p>我想可以抽空记录下奶奶的话，也算是口述历史，可以供儿孙辈翻阅看下，从历史的视角来了解先辈他们对世界，对社会，对自己的看法。</p>\n<p>一定程度上也能反思下自己，自己的角色，自己的人生观，自己的价值观，乃至历史观。</p>\n<p>奶奶上过几年学，认字对于日常的文字交流基本无障碍，但怕奶奶累着，我建议奶奶还是用语音来交流。</p>\n<p>她给我发的语音，如何提取出来编辑处理，处理微信语音的存储格式转换。</p>\n<p>特撰写记录下，如何将微信silk格式语音文件转换为wav格式。</p>\n<blockquote>\n<p>日期：2018年08月01日\n环境：MacBook Pro，macOS High Sierra 10.13.5(17F77)</p>\n</blockquote>\n<h3>第一步：找到语音文件将其导出</h3>\n<p>1、找到MAC微信语音、小视频和图片等在本地保存位置地址\n2、在对话界面右键图片有打开文件夹<br>\n<a\n    class="gatsby-resp-image-link"\n    href="/static/1533108370428-37d7e67eb6561682ff3b32c8006d7122-f45c0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 82.91233283803864%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Alt text"\n        title=""\n        src="/static/1533108370428-37d7e67eb6561682ff3b32c8006d7122-fb8a0.png"\n        srcset="/static/1533108370428-37d7e67eb6561682ff3b32c8006d7122-1a291.png 148w,\n/static/1533108370428-37d7e67eb6561682ff3b32c8006d7122-2bc4a.png 295w,\n/static/1533108370428-37d7e67eb6561682ff3b32c8006d7122-fb8a0.png 590w,\n/static/1533108370428-37d7e67eb6561682ff3b32c8006d7122-526de.png 885w,\n/static/1533108370428-37d7e67eb6561682ff3b32c8006d7122-fa2eb.png 1180w,\n/static/1533108370428-37d7e67eb6561682ff3b32c8006d7122-f45c0.png 1346w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n3、Image之上的Audio目录就是存储的会话语音<br>\n<a\n    class="gatsby-resp-image-link"\n    href="/static/1533108387726-3f6a21aeb8b72dfbbca16d248f11f9fa-e7725.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 46.59949622166247%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Alt text"\n        title=""\n        src="/static/1533108387726-3f6a21aeb8b72dfbbca16d248f11f9fa-fb8a0.png"\n        srcset="/static/1533108387726-3f6a21aeb8b72dfbbca16d248f11f9fa-1a291.png 148w,\n/static/1533108387726-3f6a21aeb8b72dfbbca16d248f11f9fa-2bc4a.png 295w,\n/static/1533108387726-3f6a21aeb8b72dfbbca16d248f11f9fa-fb8a0.png 590w,\n/static/1533108387726-3f6a21aeb8b72dfbbca16d248f11f9fa-526de.png 885w,\n/static/1533108387726-3f6a21aeb8b72dfbbca16d248f11f9fa-fa2eb.png 1180w,\n/static/1533108387726-3f6a21aeb8b72dfbbca16d248f11f9fa-e7725.png 1588w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>可以看到其后缀是.silk<br>\n<a\n    class="gatsby-resp-image-link"\n    href="/static/1533108636113-d79e99f3b8331e02d863a71925df5315-90b21.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 79.93527508090615%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Alt text"\n        title=""\n        src="/static/1533108636113-d79e99f3b8331e02d863a71925df5315-fb8a0.png"\n        srcset="/static/1533108636113-d79e99f3b8331e02d863a71925df5315-1a291.png 148w,\n/static/1533108636113-d79e99f3b8331e02d863a71925df5315-2bc4a.png 295w,\n/static/1533108636113-d79e99f3b8331e02d863a71925df5315-fb8a0.png 590w,\n/static/1533108636113-d79e99f3b8331e02d863a71925df5315-526de.png 885w,\n/static/1533108636113-d79e99f3b8331e02d863a71925df5315-fa2eb.png 1180w,\n/static/1533108636113-d79e99f3b8331e02d863a71925df5315-90b21.png 1236w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n然后就可以拷贝导出了.</p>\n<h3>第二步：处理文件转换为公众号文章可以支持发布的格式</h3>\n<p>微信公众号支持格式为mp3、wma、wav、amr<br>\n<a\n    class="gatsby-resp-image-link"\n    href="/static/1533109044741-224fe19748a2aa338d0475b03d39a40a-cc542.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 28.525641025641026%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Alt text"\n        title=""\n        src="/static/1533109044741-224fe19748a2aa338d0475b03d39a40a-fb8a0.png"\n        srcset="/static/1533109044741-224fe19748a2aa338d0475b03d39a40a-1a291.png 148w,\n/static/1533109044741-224fe19748a2aa338d0475b03d39a40a-2bc4a.png 295w,\n/static/1533109044741-224fe19748a2aa338d0475b03d39a40a-fb8a0.png 590w,\n/static/1533109044741-224fe19748a2aa338d0475b03d39a40a-526de.png 885w,\n/static/1533109044741-224fe19748a2aa338d0475b03d39a40a-fa2eb.png 1180w,\n/static/1533109044741-224fe19748a2aa338d0475b03d39a40a-cc542.png 1248w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>如果环境没有安装过homebrew</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">/usr/bin/ruby -e &quot;$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/master/install)&quot;</code></pre>\n      </div>\n<blockquote>\n<p>依赖\ngcc\nffmpeg</p>\n</blockquote>\n<p>看下环境有没有gcc，如下则有</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">ZBMAC-C02VQ200H:Desktop dubiaoqi$ gcc --version\nConfigured with: --prefix=/Library/Developer/CommandLineTools/usr --with-gxx-include-dir=/usr/include/c++/4.2.1\nApple LLVM version 9.1.0 (clang-902.0.39.2)\nTarget: x86_64-apple-darwin17.6.0\nThread model: posix\nInstalledDir: /Library/Developer/CommandLineTools/usr/bin</code></pre>\n      </div>\n<p>若无：</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">brew install gcc</code></pre>\n      </div>\n<p>安装ffmpeg</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">brew install ffmpeg</code></pre>\n      </div>\n<p>git克隆silk-v3-decoder</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">git clone https://github.com/kn007/silk-v3-decoder.git silk-v3-decoder </code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">ZBMAC-C02VQ200H:Desktop dubiaoqi$ /data/app/silk-v3-decoder/converter.sh 82.aud.silk mp3\n[Warning] Convert 82.aud.silk false, maybe not a silk v3 encoded file.</code></pre>\n      </div>\n<p>尝试转换，失败了 :（<br>\n<a href="https://kn007.net/topics/update-silk2mp3-to-official-version/">https://kn007.net/topics/update-silk2mp3-to-official-version/</a></p>\n<p>查文档，尝试其它格式转换</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">ZBMAC-C02VQ200H:silk-v3-decoder dubiaoqi$ cd silk/\nZBMAC-C02VQ200H:silk dubiaoqi$ ll\ntotal 856\n-rw-r--r--    1 dubiaoqi  wheel    3278  8  1 11:28 Makefile\n-rwxr-xr-x    1 dubiaoqi  wheel   97832  8  1 11:30 decoder\ndrwxr-xr-x    6 dubiaoqi  wheel     192  8  1 11:28 interface\n-rw-r--r--    1 dubiaoqi  wheel  335088  8  1 11:30 libSKP_SILK_SDK.a\ndrwxr-xr-x  269 dubiaoqi  wheel    8608  8  1 11:30 src\ndrwxr-xr-x    6 dubiaoqi  wheel     192  8  1 11:30 test\nZBMAC-C02VQ200H:silk dubiaoqi$ ./decoder /data/silk/82.aud.silk /data/1.pcm\n********** Silk Decoder (Fixed Point) v 1.0.9.6 ********************\n********** Compiled for 64 bit cpu *******************************\nInput:                       /data/silk/82.aud.silk\nOutput:                      /data/1.pcm\nPackets decoded:              3002\nDecoding Finished \n\nFile length:                 60.040 s\nTime for decoding:           0.072 s (0.121% of realtime)\n\nZBMAC-C02VQ200H:silk dubiaoqi$ ffmpeg -y -f s16le -ar 24000 -ac 1 -i  /data/1.pcm  -f wav -ar 16000 -b:a 16 -ac 1  /data/1.wav\nffmpeg version 4.0.2 Copyright (c) 2000-2018 the FFmpeg developers\n  built with Apple LLVM version 9.1.0 (clang-902.0.39.2)\n  configuration: --prefix=/usr/local/Cellar/ffmpeg/4.0.2 --enable-shared --enable-pthreads --enable-version3 --enable-hardcoded-tables \n  --enable-avresample --cc=clang --host-cflags= --host-ldflags= --enable-gpl --enable-libmp3lame --enable-libx264 --enable-libxvid --enable-opencl \n  --enable-videotoolbox --disable-lzma\n  libavutil      56. 14.100 / 56. 14.100\n  libavcodec     58. 18.100 / 58. 18.100\n  libavformat    58. 12.100 / 58. 12.100\n  libavdevice    58.  3.100 / 58.  3.100\n  libavfilter     7. 16.100 /  7. 16.100\n  libavresample   4.  0.  0 /  4.  0.  0\n  libswscale      5.  1.100 /  5.  1.100\n  libswresample   3.  1.100 /  3.  1.100\n  libpostproc    55.  1.100 / 55.  1.100\n[s16le @ 0x7faaef800000] Estimating duration from bitrate, this may be inaccurate\nGuessed Channel Layout for Input Stream #0.0 : mono\nInput #0, s16le, from &#39;/data/1.pcm&#39;:\n  Duration: 00:01:00.00, bitrate: 384 kb/s\n    Stream #0:0: Audio: pcm_s16le, 24000 Hz, mono, s16, 384 kb/s\nStream mapping:\n  Stream #0:0 -&gt; #0:0 (pcm_s16le (native) -&gt; pcm_s16le (native))\nPress [q] to stop, [?] for help\n[pcm_s16le @ 0x7faaee02b400] Bitrate 16 is extremely low, maybe you mean 16k\nOutput #0, wav, to &#39;/data/1.wav&#39;:\n  Metadata:\n    ISFT            : Lavf58.12.100\n    Stream #0:0: Audio: pcm_s16le ([1][0][0][0] / 0x0001), 16000 Hz, mono, s16, 256 kb/s\n    Metadata:\n      encoder         : Lavc58.18.100 pcm_s16le\nsize=    1875kB time=00:01:00.00 bitrate= 256.0kbits/s speed=2.05e+03x    \nvideo:0kB audio:1875kB subtitle:0kB other streams:0kB global headers:0kB muxing overhead: 0.004062%\nZBMAC-C02VQ200H:silk dubiaoqi$ </code></pre>\n      </div>\n<p>成功！！！转换完成<br>\n<a\n    class="gatsby-resp-image-link"\n    href="/static/1533109675534-f77af831a30a1937a78cd54aa7cca78d-a86d9.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.1904761904762%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Alt text"\n        title=""\n        src="/static/1533109675534-f77af831a30a1937a78cd54aa7cca78d-fb8a0.png"\n        srcset="/static/1533109675534-f77af831a30a1937a78cd54aa7cca78d-1a291.png 148w,\n/static/1533109675534-f77af831a30a1937a78cd54aa7cca78d-2bc4a.png 295w,\n/static/1533109675534-f77af831a30a1937a78cd54aa7cca78d-fb8a0.png 590w,\n/static/1533109675534-f77af831a30a1937a78cd54aa7cca78d-a86d9.png 672w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>相关链接<br>\nHomebrew:  <a href="https://brew.sh/">https://brew.sh/</a><br>\nFFmpeg官网：<a href="http://ffmpeg.org/">http://ffmpeg.org/</a><br>\nGit:  <a href="https://git-scm.com/">https://git-scm.com/</a><br>\n致谢kn007开源：<br>\nsilk-v3-decoder：<a href="https://github.com/kn007/silk-v3-decoder">https://github.com/kn007/silk-v3-decoder</a><br>\nkn007的回答：<a href="https://www.v2ex.com/t/171735">https://www.v2ex.com/t/171735</a>  </p>',frontmatter:{title:"如何将微信silk格式语音文件转换为wav格式",date:"2018-08-01"}}},pathContext:{slug:"/how-to-convert-silk-audio-file-from-wechat-to-wav-format/",previous:{fields:{slug:"/webpack-notes/webpack-notes-1/"},frontmatter:{title:"webpack学习笔记"}},next:null}}}});
